export declare const class1 = "// This file is part of www.nand2tetris.org\n// and the book \"The Elements of Computing Systems\"\n// by Nisan and Schocken, MIT Press.\n// File name: projects/8/FunctionCalls/StaticsTest/Class1.vm\n\n// Stores two supplied arguments in static[0] and static[1].\nfunction Class1.set 0\n\tpush argument 0\n\tpop static 0\n\tpush argument 1\n\tpop static 1\n\tpush constant 0\n\treturn\n\n// Returns static[0] - static[1].\nfunction Class1.get 0\n\tpush static 0\n\tpush static 1\n\tsub\n\treturn";
export declare const class2 = "// This file is part of www.nand2tetris.org\n// and the book \"The Elements of Computing Systems\"\n// by Nisan and Schocken, MIT Press.\n// File name: projects/8/FunctionCalls/StaticsTest/Class2.vm\n\n// Stores two supplied arguments in static[0] and static[1].\nfunction Class2.set 0\n\tpush argument 0\n\tpop static 0\n\tpush argument 1\n\tpop static 1\n\tpush constant 0\n\treturn\n\n// Returns static[0] - static[1].\nfunction Class2.get 0\n\tpush static 0\n\tpush static 1\n\tsub\n\treturn";
export declare const sys = "// This file is part of www.nand2tetris.org\n// and the book \"The Elements of Computing Systems\"\n// by Nisan and Schocken, MIT Press.\n// File name: projects/8/FunctionCalls/StaticsTest/Sys.vm\n\n// Tests that different functions, stored in two different \n// class files, manipulate the static segment correctly. \n\nfunction Sys.init 0\n\tpush constant 6\n\tpush constant 8\n\tcall Class1.set 2\n\tpop temp 0 // dumps the return value\n\tpush constant 23\n\tpush constant 15\n\tcall Class2.set 2\n\tpop temp 0 // dumps the return value\n\tcall Class1.get 0\n\tcall Class2.get 0\nlabel END\n\tgoto END";
export declare const vm_tst = "// This file is part of www.nand2tetris.org\n// and the book \"The Elements of Computing Systems\"\n// by Nisan and Schocken, MIT Press.\n// File name: projects/8/FunctionCalls/StaticsTest/StaticsTestVME.tst\n\n// Tests and illustrates the statics test on the VM emulator.\n\nload,\ncompare-to StaticsTest.cmp,\n\nset sp 261,\n\nrepeat 36 {\n\tvmstep;\n}\n\noutput-list RAM[0]%D1.6.1 RAM[261]%D1.6.1 RAM[262]%D1.6.1;\noutput;\n";
export declare const hdl_tst = "// This file is part of www.nand2tetris.org\n// and the book \"The Elements of Computing Systems\"\n// by Nisan and Schocken, MIT Press.\n// File name: projects/8/FunctionCalls/StaticsTest/StaticsTest.tst\n\n// Tests StaticTest.asm in the CPU emulator.\n// This assembly file results from translating the staticsTest folder.\n\ncompare-to StaticsTest.cmp,\n\nset RAM[0] 256,\n\nrepeat 2500 {\n\tticktock;\n}\n\noutput-list RAM[0]%D1.6.1 RAM[261]%D1.6.1 RAM[262]%D1.6.1;\noutput;\n";
